  [],\n\t\"revision_timestamp\": \"2016-02-22T20:04:29.056825\",\n\t\"name\": \"cascadia-initiative-year-3-leg-3\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Recover 30 Lamont Doherty Earth Observatory
  Ocean-bottom Seismometers (OBSs) of 3 different types:n?10 TRM shallow-water OBSs
  with Trillium compact 3-component absolute pressure gauge installed at depths from
  200-1000m (nominal). Recovered using remotely operated vehicle Jason.n?10 Trawl-Resistant
  Mount (TRM) shallow-water OBS with Trillium compact 3-component seismometer, absolute
  pressure gauge (APG), acoustic release/pop-up buoy with Jason backup.n?10 LDEO deep
  water OBSs with APG. Recover by sending an acoustic release command to dropnthe
  anchor. OBS then floats to the surface a nominal rate of 50m/min. Referred to as
  LDEO-DW below.n?Iftime allows, discover and recover 2 Woods Hole Oceanographic Institution
  deep water OBSs.nAdditional Activities: Acquire swath bathymetry, including water
  column data, in transit between all stations and port. Acquire other underway data
  (e.g. meterology, acoustic doppler current profiler).\",\n\t\"license_title\": null,\n\t\"extras\":
